    const DeleteNote = ()=>{
        alert('deleted');
    }
    return (
       <>
        <ul>
            <li>apple <Button color="primary" onClick = {DeleteNote}><DeleteIcon /></Button></li>
        </ul>
       </>
    );
}

 export default Header;
